INSERT INTO pres (id_pres, id_module, page, titre, pres, lang) VALUES (12, 'lsi', 'header', 'Lettre Système Information (début)', '<hr><p align="center"><b><span style="font-size:18px;">Rubriques Système d''Information</span></b><br></p><p align="center">La LSI est une newletter mensuelle de veille technologique spécifique au domaine de la biodiversité. Cette rubrique permet de contribuer directement à la lettre en ajoutant et enrichissant des actualités. Elle permet également de revenir sur des actualités anciennes en utilisant les systèmes de filtre et classement des actualités.</p><p align="left"><a href="https://www.youtube.com/watch?v=KABAAzWXG6I" style="text-align:left">Tutoriel vidéo n°6 - Rubrique "Lettre Système d''Information et Géomatique" </a>(3min47)</p>', 0);
